const defaultState = {
    BankAccount: null
}
const setBankAccount = "setBankAccount";

export const setBankAccountAction = (value) => {
    return {type: setBankAccount, value: value}
}

 
export  const KeysReducer = (state = defaultState, action = {type: "", value: ""}) => {
    switch (action.type) {
        case setBankAccount:
            return {...state, BankAccount: action.value}
        default:
            return state
    }
}
